<!DOCTYPE html>
<html lang="ar" dir="rtl">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Access KSA</title>
<style>
  :root{
    --gold:#c5a880;
    --bg:#0b0b0b;
    --muted:#a5a5a5;
  }
  html,body{margin:0;padding:0;background:var(--bg);color:#fff;font-family:-apple-system,Segoe UI,Roboto,Arial;scroll-behavior:smooth}
  .wrap{max-width:1100px;margin:0 auto;padding:24px}
  .hero{min-height:70vh;display:flex;align-items:center;justify-content:center;text-align:center;background:radial-gradient(60% 60% at 50% 40%, rgba(197,168,128,.18), transparent 60%)}
  .hero .card{background:rgba(0,0,0,.55);backdrop-filter:saturate(140%) blur(6px);padding:28px 26px;border-radius:18px;border:1px solid rgba(255,255,255,.06);box-shadow:0 20px 70px rgba(0,0,0,.5)}
  /* Adjust logo styling to appear smoother and blend with the page */
  /* Soften the Access logo styling to better blend with the dark background */
  .hero img.logo{display:block;margin:0 auto 14px auto;max-width:300px;width:44vw;height:auto;border-radius:24px;box-shadow:0 12px 40px rgba(197,168,128,.10),0 4px 16px rgba(0,0,0,.30);outline:1px solid rgba(255,255,255,.05)}
  h1{margin:6px 0 10px 0;font-weight:700;letter-spacing:.3px}
  .sub{color:var(--muted);margin:0 0 18px}
  .cta a{display:inline-block;padding:12px 18px;border-radius:12px;background:linear-gradient(135deg,var(--gold),#e3d2b4);color:#000;text-decoration:none;font-weight:700}
  .cta a:hover{filter:brightness(1.05)}
  .section{padding:36px 16px}
  .section h2{margin:0 0 14px}
  .section ul li{margin-bottom:15px;}
  .partners{padding:0 0 24px;border-top:1px solid rgba(255,255,255,.06);border-bottom:1px solid rgba(255,255,255,.06);background:linear-gradient(180deg, rgba(255,255,255,.02), rgba(255,255,255,0) 40%)}
  .scroller{overflow:hidden;white-space:nowrap;mask-image:linear-gradient(90deg, transparent, #000 8%, #000 92%, transparent)}
  .logo-track{display:inline-flex;gap:34px;align-items:center;animation:scroll 30s linear infinite}
  /* Increase the size of partner logos for better visibility */
  .logo-track img{height:150px;object-fit:contain;filter:grayscale(.05) brightness(1.08)}
  @keyframes scroll{from{transform:translateX(0)}to{transform:translateX(-50%)}}
  @media (max-width:560px){
    /* Adjust partner logos height on small screens */
    .logo-track img{height:120px}
    .hero img.logo{max-width:220px;width:70vw}
  }
</style>
</head>
